IF OBJECT_ID('dbo.proc_transform_380', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_380;
GO
CREATE PROCEDURE dbo.proc_transform_380
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_380
    SET payload = LEFT(payload, 1000) + N'|V4-380|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_380;
END
